The most intense and groundbreaking 45 minute performance in the history of rock.

Jimi Hendrix' debut American set at 1967's Monterey Pop Festival is generally
considered one of the most radical and legendary live shows ever.

Virtually unknown to American audiences at the time, but already an established
entity in the UK, Hendrix and his two-piece Experience explode on stage, ripping
through blues classics &quot;Rock Me Baby&quot; and Howlin' Wolf's &quot;Killing Floor&quot;
interpreting and electrifying Bob Dylan's &quot;Like a Rolling Stone&quot; debuting songs
from his yet-to-be-released first album and closing with the now historic
sacrificial burning of his guitar during an unhinged version of &quot;Wild Thing&quot;

